import logo from './logo.svg';
import './App.css';
import Login from './component/Login';
import { Link, Routes, Route, Router } from 'react-router-dom';


function App() {
  return (
    <div className="App">
   <nav>
    <Link to="/Login" >Login</Link>
   </nav>
      <div>
      <Route path="/Login" element={ <Login /> } />
      </div>
    </div>
  );
}

export default App;
